import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import MembershipRegister from './membershipRegister';
import Events from './events';
import PhotosVideo from './photosVideo';
import Donation from './donation';
import About from './about';  
import Contact from './contact';
import AdminLogin from './adminlogin';
import './styles.css'; // Import your CSS styles

// Header component
function Header() {
    return (
        <header>
            {/* Nigeria flag on the top left */}
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR1jFIfSvWwsEe-bf6k3_UDFN85CwtSHu9Puw&s" alt="Nigeria Flag" className="flag flag-left" />

            {/* Italy flag on the top right */}
            <img 
                src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQkU0tjUdDG83Yt6Dxrya21YMN3L00LWB2Vew&s" 
                alt="Italy Flag" 
                className="flag flag-right" 
            />
            
            {/* Centered logo */}
            <a href="/">
                <img 
                    src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRJVPwfUMs4W-5MyRdUmAj_UMB2y8gxtpjBjw&s" // Replace this with the actual logo URL
                    alt="Edo Cultural Association Logo" 
                    className="Edo Cultural Association Logo" 
                />
            </a>
            
            <h1>Edo Cultural Association</h1>
            <p>Friuli Venezia Giulia Udine Italy</p>
        </header>
    );
}

// Navigation component
function Nav() {
    return (
        <nav>
            <Link to="/">Homepage</Link>
            <Link to="/membership-register">Membership Register</Link>
            <Link to="/events">Events</Link>
            <Link to="/photos-video">Photos & Video</Link>
            <Link to="/donation">Donation</Link>
            <Link to="/about">About</Link>
            <Link to="/contact">Contact</Link>
            <Link to="/admin">Admin</Link>
        </nav>
    );
}

// Main component
function Main() {
    return (
        <main>
            <Routes>
                <Route path="/" element={<Homepage />} />
                <Route path="/membership-register" element={<MembershipRegister />} />
                <Route path="/events" element={<Events />} />
                <Route path="/photos-video" element={<PhotosVideo />} />
                <Route path="/donation" element={<Donation />} />
                <Route path="/about" element={<About />} />
                <Route path="/contact" element={<Contact />} />
                <Route path="/admin" element={<AdminLogin />} />
            </Routes>
        </main>
    );
}

// Dummy component for the homepage
function Homepage() {
    return (
        <section id="homepage">
            <h2>Welcome to Edo Cultural Association</h2>
            <img 
                src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTtnKhmACeNBgQY7S0Z_Cskszra7yL-h2R5LQ&s" // Replace with the actual image URL
                alt="Cultural Event Overview" 
                className="homepage-image" 
            />

            {/* Image Section 1 */}
            <div className="image-section">
                <h3>Our Cultural Events</h3>
                <div className="gallery">
                    <img 
                        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTtnKhmACeNBgQY7S0Z_Cskszra7yL-h2R5LQ&s" 
                        alt="Cultural Event 1" 
                        className="fade-in" 
                    />
                    <img 
                        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS_Eo9t5DrqDLWTc85y77vtrLcfNLWD38Zmag&s" 
                        alt="Cultural Event 2" 
                        className="fade-in" 
                    />
                    <img 
                        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSiQ9Rg6-oTnU49ALoLvkxFkZVRUeY8kzvwFQ&s" 
                        alt="Cultural Event 3" 
                        className="fade-in" 
                    />
                </div>
            </div>

            {/* Image Section 2 */}
            <div className="image-section">
                <h3>Traditional Celebrations</h3>
                <div className="gallery">
                    <img 
                        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQId9DJJIvnX7bLhIUL8bbcRhSZCLK0xAEumw&s" 
                        alt="Celebration 1" 
                        className="fade-in" 
                    />
                    <img 
                        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTOsPnmoOLhaady5ouPuVTepFeSJVlhVh5UFw&s" 
                        alt="Celebration 2" 
                        className="fade-in" 
                    />
                    <img 
                        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQkU0tjUdDG83Yt6Dxrya21YMN3L00LWB2Vew&s" 
                        alt="Celebration 3" 
                        className="fade-in" 
                    />
                </div>
            </div>

            {/* Image Section 3 */}
            <div className="image-section">
                <h3>Art and Crafts</h3>
                <div className="gallery">
                    <img 
                        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQId9DJJIvnX7bLhIUL8bbcRhSZCLK0xAEumw&s" 
                        alt="Art 1" 
                        className="fade-in" 
                    />
                    <img 
                        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSiQ9Rg6-oTnU49ALoLvkxFkZVRUeY8kzvwFQ&s" 
                        alt="Art 2" 
                        className="fade-in" 
                    />
                    <img 
                        src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSYN7adiaeZRZmYnfpa1HYXodVLcffWGRR08g&s" 
                        alt="Art 3" 
                        className="fade-in" 
                    />
                </div>
            </div>

            {/* Video Section */}
            <div className="video-container">
                <h3>Watch Our Cultural Highlights</h3>
                <video width="600" controls>
                    <source src="your-video-url.mp4" type="video/mp4" /> {/* Replace with your video URL */}
                    Your browser does not support the video tag.
                </video>
            </div>

            {/* President's Information */}
            <div className="president-info">
                <h3>President: King Luca</h3> {/* Replace with the president's name */}
                <p>Took office: January 2023</p> {/* Replace with the date of taking office */}
                <img 
                    src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSYN7adiaeZRZmYnfpa1HYXodVLcffWGRR08g&s" // Replace with the actual president's picture URL
                    alt="President King Luca" 
                    className="president-picture" 
                />
            </div>
        </section>
    );
}


// Footer component
function Footer() {
    return (
        <footer>
            <div className="marquee">
                &copy; {new Date().getFullYear()} Edo Cultural Association. All rights reserved.
            </div>
        </footer>
    );
}

function App() {
    return (
        <Router>
            <div id="app"> {/* Add an ID for styling */}
                <Header />
                <Nav />
                <Main />
                <Footer />
            </div>
        </Router>
    );
}

export default App;
